import Nav from "./Nav";
import StoreContext from '../../StoreContext';

const NavContainer = (props) => {
    return(
        <StoreContext.Consumer>
            {
                (store) => {
                    let state = store.getState();
                   return <Nav data={state.NavMenu} />
                }
            }
        </StoreContext.Consumer>
    )
}

export default NavContainer;
